export default function Restore() {
  return (
    <div className="menu-box">
      <RestoreMember />
      <RestoreBoard />

    </div>
  );
}


const RestoreMember = () => {
  return (
      <section className="section-border">
      <h2>탈퇴 회원 복구</h2>

      <h3>탈퇴한 회원 목록</h3>

    </section>
  )


}

const RestoreBoard = () => {
  return (
      <section className="section-border">
      <h2>삭제 게시글 복구</h2>

      <h3>삭제된 게시글 목록</h3>

    </section>
  )
}
